n\",\"col2\":\"\",\"col6\":\"262\",\"col3\":\"52\",\"col4\":\"0\",\"col5\":\"6\",\"col7\":\"\"},{\"col1\":\"Jerk Dressing\",\"col2\":\"\",\"col6\":\"15\",\"col3\":\".5\",\"col4\":\"3\",\"col5\":\"0\",\"col7\":\"\"},{\"col1\":\"Brown Rice\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\"579\",\"col1\":\"60\",\"col2\":\"62\",\"col3\":\"10\",\"col6\":\"41\",\"col7\":\"43\",\"col8\":\"16\"}]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2017-09-04 17:04:30','2018-06-20 14:46:06','b7420d60-7876-4a1f-a8cc-6aff38a01408'),(99,99,'en_us','Featured',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2017-09-04 17:45:53','2017-09-04 17:45:53','7f68db26-1144-4578-b247-fc90d9d44d92'),(100,100,'en_us','Seasonal',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2017-09-04 17:47:17','2017-09-04 17:47:17','c2867d27-ba6e-4885-ad2d-b7566a523f31'),(105,105,'en_us','Autumn Flavors','[{\"col1\":\"Chicken\",\"col2\":\"\",\"col6\":\"262\",\"col3\":\"52\",\"col4\":\"0\",\"col5\":\"6\",\"col7\":\"\"},{\"col1\":\"Apple Butter\",\"col2\":\"\",\"col6\":\"88\",\"col3\":\"1\",\"col4\":\"21\",\"col5\":\"0\",\"col7\":\"\"},{\"col1\":\"Marinate\",\"col2\":\"\",\"col6\":\"25\",\"col3\":\".5\",\"col4\":\"0\",\"col5\":\"2.5\",\"col7\":\"\"},{\"col1\":\"Green Beans\",\"col2\":\"4oz\",\"col6\":\"67\",\"col3\":\"2.5\",\"col4\":\"9\",\"col5\":\"1\",\"col7\":\"\"},{\"col1\":\"Winter Squash\",\"col2\":\"5oz\",\"col6\":\"60\",\"col3\":\"1\",\"col4\":\"14\",\"col5\":\"0\",\"col7\":\"\"},{\"col1\":\"EVOO\",\"col2\":\"\",\"col6\":\"126\",\"col3\":\"0\",\"col4\":\"0\",\"col5\":\"14\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\"520\",\"col1\":\"57\",\"col2\":\"44\",\"col3\":\"12\"}]','With Butternut Squash','Microwave oh high power for 2 minutes or until heated through. (Apple butter is delicious hot or cold, just remove the lid of plastic cup prior to heating)','2018-01-31 05:00:00','Contains Egg and Awesomeness.',NULL,'A lightly flavored chicken breast with green beans and our signature roasted butternut squash. These flavors are reminiscent of cool Autumn days. The homemade apple butter is spiced and sweet and the perfect pairing for the light flavor of the chicken and the sweetness of the squash. ',NULL,NULL,1,'2017-09-04 19:49:53','2018-04-07 00:56:33','4baf3566-e6fa-4c6f-8057-8fdeeda82cb5'),(106,106,'en_us','Large','[{\"col1\":\"Baked Chicken\",\"col2\":\"4 oz\",\"col6\":\"262\",\"col3\":\"52\",\"col4\":\"0\",\"col5\":\"6\",\"col7\":\"\"},{\"col1\":\"Apple Butter\",\"col2\":\"\",\"col6\":\"88\",\"col3\":\"1\",\"col4\":\"21\",\"col5\":\"0\",\"col7\":\"\"},{\"col1\":\"Green Beans\",\"col2\":\"4oz\",\"col6\":\"67\",\"col3\":\"2.5\",\"col4\":\"9\",\"col5\":\"1\",\"col7\":\"\"},{\"col1\":\"Winter Squash\",\"col2\":\"5oz\",\"col6\":\"60\",\"col3\":\"1\",\"col4\":\"14\",\"col5\":\"0\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\"463\",\"col1\":\"57\",\"col2\":\"43\",\"col3\":\"7\",\"col6\":\"49\",\"col7\":\"37\",\"col8\":\"14\"}]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2017-09-04 19:49:53','2018-04-07 00:56:33','c29cf234-ad43-4fdf-8a5c-075a6195f2bf'),(113,113,'en_us','Roasted Chicken',NULL,'[{\"col5\":\"\",\"col4\":\"490\",\"col1\":\"58\",\"col2\":\"38\",\"col3\":\"12\"}]','With Broccoli','Remove plastic cup.  Microwave on high for 2 minutes or until heated through. ','2018-01-30 05:00:00','Contains egg and awesomeness.',NULL,'This everyday type of meal may not seem exciting. We think youll be surprised though. The roasting of the broccoli brings out subtle nutty hints to the vegetable which pairs perfectly with the roasted chicken. The potatoes are baked to perfection and come with homemade fresh salsa to give them a little spice. ',NULL,NULL,4,'2017-09-10 23:09:54','2018-05-08 17:27:37','4e47b9c6-7800-4f21-a702-632702346c12'),(114,114,'en_us','Large','[{\"col1\":\"Chicken\",\"col2\":\"6oz\",\"col6\":\"262\",\"col3\":\"52\",\"col4\":\"0\",\"col5\":\"6\",\"col7\":\"\"},{\"col1\":\"Marinade\",\"col2\":\"\",\"col6\":\"15\",\"col3\":\".5\",\"col4\":\"3\",\"col5\":\"0\",\"col7\":\"\"},{\"col1\":\"Baked Potato\",\"col2\":\"4oz\",\"col6\":\"104\",\"col3\":\"2\",\"col4\":\"24\",\"col5\":\"0\",\"col7\":\"\"},{\"col1\":\"Broccoli\",\"col2\":\"5oz\",\"col6\":\"48\",\"col3\":\"4\",\"col4\":\"10\",\"col5\":\".05\",\"col7\":\"\"},{\"col1\":\"Fresh Salsa\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\"458\",\"col1\":\"60\",\"col2\":\"39\",\"col3\":\"6\",\"col6\":\"53\",\"col7\":\"35\",\"col8\":\"12\"}]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2017-09-10 23:09:54','2018-05-08 17:27:37','cbf356b9-5035-4b39-846a-15c7ff68ddd1'),(122,122,'en_us','Turkey',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Turkey has a high protein content and contains Iron, Zinc, Potassium, and Phosphorus which help to regulate sleep.  It also has large quantities of B6 and niacin which are essential for metabolism and energy production.  ',NULL,0,'2017-09-18 23:12:02','2017-11-18 23:39:24','3d38e5e0-4ebc-4844-88c8-519588639a17'),(123,123,'en_us','Momma\'s Turkey Meatloaf',NULL,'[{\"col5\":\"\",\"col4\":\"360\",\"col1\":\"42\",\"col2\":\"16\",\"col3\":\"15\"}]','with green beans','Microwave on high power for 1-2 minutes or until heated through. Remove plastic cup or pour marinara sauce on meatloaf prior to heating. ','2018-02-01 05:00:00','Contains egg and awesomeness. ',NULL,'Mommas Meatloaf has never been so good (for you). The ground turkey reduces the calories and fat content of this conventional dish while maintaining the high protein content. This meal is ideal for anyone looking to enhance those muscle gains from the gym. ',NULL,NULL,2,'2017-09-18 23:12:34','2018-04-07 00:57:20','0b07e5f6-9654-463a-a73e-e734c224c43c'),(124,124,'en_us','Large','[{\"col1\":\"Egg\",\"col2\":\"\",\"col6\":\"69\",\"col3\":\"6\",\"col4\":\"0\",\"col5\":\"6\",\"col7\":\"\"},{\"col1\":\"Ground Turkey\",\"col2\":\"\",\"col6\":\"163\",\"col3\":\"24\",\"col4\":\"1\",\"col5\":\"7\",\"col7\":\"\"},{\"col1\":\"Tomato Sauce\",\"col2\":\"\",\"col6\":\"33.5\",\"col3\":\"1\",\"col4\":\"4\",\"col5\":\"1.5\",\"col7\":\"\"},{\"col1\":\"Green Beans\",\"col2\":\"\",\"col6\":\"67\",\"col3\":\"2.5\",\"col4\":\"9\",\"col5\":\"1\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\"396\",\"col1\":\"43\",\"col2\":\"20\",\"col3\":\"16\",\"col6\":\"44\",\"col7\":\"20\",\"col8\":\"36\"}]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2017-09-18 23:12:34','2018-04-07 00:57:20','d2de3eef-8710-48f0-b6c3-c7892b3b6983'),(125,125,'en_us','Garam Masala Lentils',NULL,'[{\"col5\":\"\",\"col4\":\"260\",\"col1\":\"15\",\"col2\":\"38\",\"col3\":\"6\"}]','','Microwave on high power for 2 minutes or until heated through.','2018-02-01 05:00:00','',NULL,'The very flavorful spice mixture of Garam Masala is used in many Indian dishes. These lentils are slightly spicy and paired with the nutty flavor of quinoa and roasted cauliflower. This makes a great vegan dish that provides a complete essential amino acid profile. ',NULL,NULL,5,'2017-09-18 23:17:01','2018-04-07 00:57:00','aa7e573d-ff82-47f3-963d-fff9c6f7106c'),(126,126,'en_us','Large','[{\"col1\":\"Garam MasalaLentils\",\"col2\":\"\",\"col6\":\"68\",\"col3\":\"8\",\"col4\":\"9\",\"col5\":\"0\",\"col7\":\"\"},{\"col1\":\"Sesame Oil\",\"col2\":\"\",\"col6\":\"126\",\"col3\":\"0\",\"col4\":\"0\",\"col5\":\"14\",\"col7\":\"\"},{\"col1\":\"Quinoa\",\"col2\":\"\",\"col6\":\"110\",\"col3\":\"4\",\"col4\":\"19\",\"col5\":\"2\",\"col7\":\"\"},{\"col1\":\"Cauliflower\",\"col2\":\"\",\"col6\":\"28\",\"col3\":\"2\",\"col4\":\"5\",\"col5\":\"0\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\"265\",\"col1\":\"17\",\"col2\":\"40\",\"col3\":\"4\",\"col6\":\"26\",\"col7\":\"60\",\"col8\":\"14\"}]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2017-09-18 23:17:01','2018-04-07 00:57:00','ce1c0274-b5bb-42ed-866c-9b67dddf65be'),(127,127,'en_us','Taco Tuesday TVP',NULL,'[{\"col5\":\"\",\"col4\":\"430\",\"col1\":\"32\",\"col2\":\"53\",\"col3\":\"10\"}]','','Remove plastic cup.   Microwave on high for 2 minutes or until heated through. Mix together, spinach will be wilted. ','2018-02-02 05:00:00','Contains soy, and awesomeness. ',NULL,'It doesnt have to be Tuesday to enjoy this delicious, completely vegan take on taco salad. The TVP taco mixture is tangy and spicy with tomatoes and jalapeos. The black beans are slow cooked overnight with a signature combination of spices. All of this is on top of fresh baby spinach that is meant to be heated together to make this a slightly wilted, warm salad. It is then topped with fresh homemade tomato salsa. ',NULL,NULL,1,'2017-09-18 23:18:25','2018-04-02 21:56:39','ed0212e4-43ba-4a67-8cfb-80158458f77e'),(128,128,'en_us','Large','[{\"col1\":\"Textured Vegetable Protein (TVP) Mixture\",\"col2\":\"2oz\",\"col6\":\"80\",\"col3\":\"12\",\"col4\":\"8\",\"col5\":\"0\",\"col7\":\"\"},{\"col1\":\"Spinach\",\"col2\":\"\",\"col6\":\"8\",\"col3\":\"1\",\"col4\":\"1\",\"col5\":\"0\",\"col7\":\"\"},{\"col1\":\"Black Beans \",\"col2\":\"\",\"col6\":\"166\",\"col3\":\"10\",\"col4\":\"27\",\"col5\":\"2\",\"col7\":\"\"},{\"col1\":\"Fresh Salsa\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\"377\",\"col1\":\"31\",\"col2\":\"54\",\"col3\":\"4\",\"col6\":\"33\",\"col7\":\"57\",\"col8\":\"10\"}]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2017-09-18 23:18:25','2018-04-02 21:56:39','c68f08f1-e9a6-408b-80f6-2eb95cd4125c'),(129,129,'en_us','Medium ','[{\"col1\":\"Baked Chicken\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"},{\"col1\":\"Apple Butter\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"},{\"col1\":\"Green Beans\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"},{\"col1\":\"Winter Squash\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\