st too.  ',NULL,NULL,3,'2017-10-29 17:49:45','2018-04-07 00:56:02','82905b1d-7dfd-4b7a-9af6-97eb6f92b6ef'),(152,152,'en_us','Vegan','[{\"col1\":\"Baked Polenta\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"},{\"col1\":\"Butternut Squash Sauce\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"},{\"col1\":\"Green Beans\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"},{\"col1\":\"\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\"249\",\"col1\":\"7\",\"col2\":\"43\",\"col3\":\"6\",\"col6\":\"11\",\"col7\":\"67\",\"col8\":\"22\"}]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2017-10-29 17:49:45','2018-04-07 00:56:02','68de3efc-4442-4736-a398-9c91a5272809'),(153,153,'en_us','With Chicken','[{\"col1\":\"Baked Polenta\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"},{\"col1\":\"Butternut Squash Sauce\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"},{\"col1\":\"Green Beans\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"},{\"col1\":\"Baked Chicken\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\"526\",\"col1\":\"60\",\"col2\":\"46\",\"col3\":\"12\",\"col6\":\"45\",\"col7\":\"35\",\"col8\":\"20\"}]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2017-10-29 17:49:45','2018-04-07 00:56:02','9bad556a-8694-44ed-bfb2-bec8d2cb12bc'),(155,155,'en_us','BBQ Chicken Meal',NULL,NULL,'with coleslaw','Remove plastic cup of coleslaw. Pour extra sauce on chicken and microwave for 1 to 2 minutes, or until heated through. ','2018-02-02 05:00:00','None',NULL,'This low carb meal is high in flavor and filling. Its not your usual BBQ, but it is a satisfying meal nonetheless. Pulled BBQ chicken pairs perfectly with our own homemade coleslaw to make